import { ContractFactory, decompressBytecode } from 'fuels';
import type { Account, DeployContractOptions, Provider } from 'fuels';

import { WarpRoute } from './WarpRoute.js';

const bytecode = decompressBytecode(
  '',
);

export class WarpRouteFactory extends ContractFactory {
  static readonly bytecode = bytecode;

  constructor(accountOrProvider: Account | Provider) {
    super(bytecode, WarpRoute.abi, accountOrProvider);
  }

  static deploy(wallet: Account, options: DeployContractOptions = {}) {
    const factory = new WarpRouteFactory(wallet);
    options.storageSlots = WarpRoute.storageSlots;
    return factory.deploy<WarpRoute>(options);
  }
}
